import styles from "./../assets/pages/DashBoard.module.css";

import Services from "./../components/Services";
import Logs from "./../components/Logs";

function DashBoard(){
    return (
        <div className={styles.containerDashBoard}>
            <Services />
            <Logs />
        </div>
    );
}

export default DashBoard;
